import React from 'react';
import './App.css';
import Counter from './Counter';

function App() {

  const voters: [] = [
    "Anthony Sistilli ",
    "Bob Smith",
    "Stephanie Foo",
    "Kevin Ma"
  ];

  return (
    <div className="App">
      {voters.map(voter => (
        <Counter name={voter} />
      ))}
    </div>
  );
}

export default App;
